        <div className="col-4 bg-white rounded">2</div>
        <div className="col-4 bg-primary rounded">3</div>
        <div className="col-4 bg-success rounded">4</div>
        <div className="col-4 bg-success rounded">4</div>
        <div className="col-4 bg-success rounded">4</div>
        <div className="col-4 bg-success rounded">4</div>
      </div>
    </div>
  );
};

